import React from "react";
import { useGallary } from "../../context/gallaryContext";

const CartList = () => {
  const { cartItems } = useGallary();
  console.log(cartItems);
  return (
    <div className="px-5 py-10">
      {cartItems.length > 0 &&
        cartItems.map((item) => (
          <div>
            <img src={item.url} alt="" />
          </div>
        ))}
    </div>
  );
};

export default CartList;
